	('711ce62d-6c6b-4246-8418-2a97ca9cea6b', 'After years of waiting, Israel''s Netanyahu finally makes his move on Iran', 'https://www.reuters.com/world/middle-east/after-years-waiting-israels-netanyahu-finally-makes-his-move-iran-2025-06-13', 'Netanyahu threatened Iran for years, many saw it as a bluff. Israeli leader sees Iran as existential threat to Israel. Recent Middle East tumult provided a rare chance to strike. Netanyahu hopes success will secure his legacy.', '2025-06-13 17:12:09+00', 'International', 'Reuters', 'https://www.reuters.com/world/middle-east/after-years-waiting-israels-netanyahu-finally-makes-his-move-iran-2025-06-13', '2025-06-21 17:24:11.817448+00', '2025-06-21 17:33:40.21328+00', NULL, true, '2025-06-21 17:33:40.21+00', '[iframe](about:blank)[iframe](javascript:false)

