	('8fd39669-f751-4b4f-86b4-7bca020a1c5f', 'Israeli Prime Minister Netanyahu Meets US Officials to Discuss Military Operations Against Iran', 'https://www.iranintl.com/en/202506209431', 'Israeli Prime Minister Benjamin Netanyahu and senior military officials met with top US officials to discuss potential American involvement in Israel’s military operations against Iran.', '2025-06-20 11:21:54.611+00', 'Iran-Specific', 'Iran International', 'https://www.iranintl.com/en/202506209431', '2025-06-21 17:23:15.344782+00', '2025-06-21 17:33:29.343732+00', NULL, true, '2025-06-21 17:33:29.34+00', 'Israeli Prime Minister Benjamin Netanyahu and senior military officials met with top US officials on Thursday night in Washington to discuss potential American involvement in Israel’s military operations against Iran, The Jerusalem Post reported.

