	('5dafd54c-9377-4949-9b9c-836e407c0242', 'Investors see quick stock market drop if U.S. joins Israel-Iran conflict', 'https://www.reuters.com/world/middle-east/investors-see-quick-stock-market-drop-if-us-joins-israel-iran-conflict-2025-06-18', 'Investors fear U.S. involvement in Israel-Iran conflict could affect stock markets. Oil prices may rise sharply if U.S. attacks Iran, impacting global economy. Dollar gains as investors seek safe haven.', '2025-06-18 20:51:02+00', 'International', 'Reuters', 'https://www.reuters.com/world/middle-east/investors-see-quick-stock-market-drop-if-us-joins-israel-iran-conflict-2025-06-18', '2025-06-21 17:27:00.150987+00', '2025-06-21 17:33:54.164522+00', NULL, true, '2025-06-21 17:33:54.16+00', '[iframe](about:blank)[iframe](javascript:false)

