	('f4b0a660-b89e-4e4d-8db9-a3333ae6653b', '1ea31feb-d09c-45b4-8d50-965ade18b353', 0, 'Source: Iran International Title: Iran uses embassies abroad for surveillance and subterfuge, ex-staff say Description: Iran uses its overseas missions to covertly surveil dissidents and fund influence operations via state-backed cultural initiatives, multiple former Iranian diplomats and embassy staff members told Iran International. ![Iran uses embassies abroad for surveillance and subterfuge, ex-staff say](https://i.iranintl.com/images/rdk9umy0/production/1c358434f9788b0a33c9741ca1e541fa6ad6f7c6-1734x887.png?rect=339,0,1248,832&w=600&h=400&q=80&fit=crop&auto=format) Iran uses its overseas missions to covertly surveil dissidents and fund influence operations via state-backed cultural initiatives, multiple former Iranian diplomats and embassy staff members told Iran International. ![UK warns of ‘extraordinary’ threat from Iran and Russia - NYT](https://i.iranintl.com/images/rdk9umy0/production/5e1c2ac68c687de944d4c79d2adbe8caced8c8c2-2817x1878.jpg?w=600&h=400&q=80&fit=crop&auto=format) Iran and Russia are posing an “extraordinary” threat to the United Kingdom through plots involving espionage, sabotage, and intimidation, Britain’s independent adviser on state threats and terrorism told The New York Times in an interview published Friday. Iran is conducting increasingly hostile intelligence operations targeting Finland, the Finnish Security and Intelligence Service (Supo) told public broadcaster Yle in', 150, '[-0.080180414,0.026113924,0.026255358,0.023773829,-0.011571901,-0.008016756,-0.0064481203,0.02905833,-0.028466877,0.0057152333,-0.005535226,-0.023735255,0.007798176,0.029392628,0.023915263,0.06819707,-0.044641823,0.03831585,-0.052227847,0.04759909,0.020469407,0.047984816,0.010588289,0.004596616,0.023863832,-0.0061556087,0.000527968,0.0059016696,0.011700477,0.015866362,0.08002613,-0.046133313,0.00843463,-0.007669599,-0.0045805443,-0.010395424,0.026743948,-0.03291563,0.02705253