	('473ba4f2-5ab0-47d2-bda9-151b906d4b09', '1ea31feb-d09c-45b4-8d50-965ade18b353', 1, 'The New York Times in an interview published Friday. Iran is conducting increasingly hostile intelligence operations targeting Finland, the Finnish Security and Intelligence Service (Supo) told public broadcaster Yle in comments published Friday. Roozbeh Parsi, head of the Middle East and North Africa Program at the Swedish Institute of International Affairs (UI), has stepped down following the conclusion of an internal investigation into his alleged links to an Iranian influence network. ![Voices aligned with Tehran should not get a free ride in West ](https://i.iranintl.com/images/rdk9umy0/production/faccb267861ae12bd14a93478cd7fa151d3a0d40-992x558.jpg?rect=78,0,837,558&w=600&h=400&q=80&fit=crop&auto=format) The campaigns against advocates of Tehran interests outside Iran is not about stifling debate but ensuring a balanced one, with dissenting voices challenging those more aligned with the Islamic Republic. ![Britain denies funding Iran''s influence operation in West](https://i.iranintl.com/images/rdk9umy0/production/6f0d4f2d50fc3b5ee33de99bf10903f8e685989d-5500x3594.jpg?rect=55,0,5391,3594&w=600&h=400&q=80&fit=crop&auto=format) The British government has not funded Iran''s influence network in Western countries, the UK Foreign Office told Iran International, rejecting remarks by a Swedish-Iranian scholar who said his', 150, '[-0.07395081,-0.027104251,0.05818537,0.018037938,-0.008006998,0.004178079,-0.04675187,0.014676537,0.0016363156,0.0021526574,-0.023399608,-0.048811324,-0.0039798273,0.028311513,0.022417227,0.06003177,-0.024453005,0.0077111,-0.053356316,0.06519223,-0.0014484203,0.03910587,0.008563286,0.03318791,0.024808083,0.016274387,0.0031187641,-0.019896178,-0.0060244817,0.0038141243,0.10377732,-0.034513533,-0.0056841993,-0.02722261,-0.036715016,-0.04234891,-0.0057670507,-0.038395714,0.041188993,-0.009445062,-0.023873044,-0.040762898,-0.030394636,-0.027554015,-0.009409554,