	('fefb33bb-7653-49ed-9371-2de282484023', 'e443d556-e4ac-43a2-8512-a5d67a6b4619', 0, 'Source: Iran International Title: Trump to Decide on Military Strike Against Iran Within Two Weeks Description: The White House announced that President Trump will decide within two weeks on a potential military strike against Iran, citing the country''s proximity to obtaining a nuclear weapon. The White House said on Thursday that President Donald Trump will make a decision within two weeks on whether to launch a military strike on Iran. Citing a message from Trump, White House Press Secretary Karoline Leavitt told reporters: "Based on the fact that there''s a substantial chance of negotiations that may or may not take place with Iran in the near future, I will make my decision whether or not to go within the next two weeks." “It is a fact and the United States government maintains this fact that Iran has never been closer to obtaining a nuclear weapon,” Leavitt said when asked whether', 150, '[-0.086180836,0.025830224,0.035041,0.016609434,-0.013826177,0.014326763,0.05150026,0.047976136,0.024789006,0.016208965,0.014216634,-0.002436601,-0.06207263,0.008730215,0.021945678,0.0003920212,-0.045453183,0.0135758845,-0.0248691,-0.02733198,0.0048181377,0.048096277,0.014096494,-0.02370774,0.05021876,-0.0189722,-0.039366063,-0.025069334,0.0097413985,0.002835818,0.06884055,-0.0235876,-0.020864412,-0.065676846,-0.03235786,-0.040967934,0.023427412,0.004034721,0.031496853,-0.022506334,-0.01010182,0.0061221635,-0.005186068,0.03235786,-0.008685162,-0.045453183,-0.010912769,-0.00896549,0.042369574,0.0103120655,-0.015017572,-0.012504632,-0.065036096,0.024568748,-0.016689528,-0.037503883,-0.013876236,-0.00045052715,0.007228458,-0.010882733,0.013816166,-0.0152979,-0.026671207,0.028273081,0.008379805,-0.03391969,0.023247201,0.049377777,0.0075538387,0.0057667475,-0.023567576,0.050418995,-0.003716849,0.010422194,0.040126953,-0.002067419,-0.00081157463,-0.048536792,0.07096303,0.011173073,-0.022866756,-0.0