	('166fb419-5b31-4b15-b8db-f39b7d6bd9f7', '1ea31feb-d09c-45b4-8d50-965ade18b353', 4, 'access to intelligence, according to a former Pentagon official. ![Iranian political rivals trade accusations of ‘Israeli infiltrators’](https://i.iranintl.com/images/rdk9umy0/production/11568ff26bd10e63372bf22f79d7a39c15589326-4574x2775.jpg?rect=206,0,4163,2775&w=600&h=400&q=80&fit=crop&auto=format) Supporters of rival factions in Iran have taken to social media to make allegations of Israeli ‘infiltration’ and espionage against each other in the wake of Israel’s recent deadly operations. ![Iran uses UN General Assembly to conduct influence operation in US](https://i.iranintl.com/images/rdk9umy0/production/4fd1374e20a371a93ae55cc82e202c850f955730-640x443.jpg?rect=0,9,640,427&w=600&h=400&q=80&fit=crop&auto=format) The circus is back in town. A new Iranian president arrives at the United Nations as a smiling mask to an undeterred adversary of the United States and too many credulous media and policy elites in this country cheer on the pageant. This needs to stop. ![Malley’s ‘sloppy’ work as Biden’s Iran envoy led to suspension – WSJ](https://i.iranintl.com/images/rdk9umy0/production/8ab97b40895efd9489a0e96ca37eece66fd8f66d-1024x576.jpg?rect=80,0,864,576&w=600&h=400&q=80&fit=crop&auto=format) Rob Malley, US special envoy for Iran, is under FBI investigation for mishandling classified information, though the State Department believes no serious misconduct occurred, according to a new Wall Street Journal report.', 149, '[-0.026257655,0.0100831,0.014329676,0.045028456,0.03297972,0.015174965,0.029464388,0.020541884,0.016127594,-0.0006452882,-0.004924149,-0.07341946,-0.051924948,0.006349737,-0.014369927,0.04779242,-0.043150034,0.013571598,-0.018395117,-0.0006473847,-0.0062558157,0.049912352,0.0059774066,0.031181803,0.039071176,0.0060679736,-0.018743968,-0.041620463,0.021588434,0.03652189,0.12365383,-0.02667359,0.017643748,-0.045296803,-0.031369645,0.008761496,0.024231642,-0.034884978,0.02