	('90f6f1c2-58fc-42f0-a4c4-a767798e141a', '1ea31feb-d09c-45b4-8d50-965ade18b353', 7, 'Ali Khamenei. ![US accuses Iran of exploiting anti-war protests on university campuses](https://i.iranintl.com/images/rdk9umy0/production/f2c17591f6709abec1a2efeebcdf8a621a464e1c-1200x629.png?rect=128,0,944,629&w=600&h=400&q=80&fit=crop&auto=format) The Iranian government has tried to hijack ongoing Gaza war protests in US universities, and actors close to Tehran have provoked and financially supported the protesters, the Director of US National Intelligence said on Tuesday, as she warned against Iran''s influence efforts. ![Arab League Removes Hezbollah From Terror List; How Iran Benefits ](https://i.iranintl.com/images/rdk9umy0/production/8332834928d7157ab9a6f43276a3d99de823dc77-5500x3667.jpg?w=600&h=400&q=80&fit=crop&auto=format) The Arab league is no longer classifying Hezbollah as a terrorist entity, a move that experts say is a big win for Iran and serves to strengthen the Iranian proxy in Lebanon. ![Potomac Mosque''s Ties to Tehran Remain Under Scrutiny](https://i.iranintl.com/images/rdk9umy0/production/37f53e3c10380a8333a5647df46074385471c6c1-2560x912.jpg?rect=596,0,1368,912&w=600&h=400&q=80&fit=crop&auto=format) A helicopter crash on May 19 claimed the lives of Ebrahim Raisi, Iran''s eighth President, and his foreign minister, Hossein Amir-Abdollahian, leading to a series of consequential events. Load More', 135, '[-0.0509178,-0.03474475,0.020839725,0.031348646,-0.0037849927,-0.009558962,-0.0026301988,0.033889785,-0.0127769485,-0.0066912733,-0.01895168,-0.028855003,-0.046904225,-0.003241735,-0.007938094,0.023594607,-0.033414807,0.017526742,-0.0121713495,0.016493663,0.017906727,0.015543704,-0.0036514048,0.03396103,0.06507219,0.025411403,-0.008822744,-0.0036929655,0.023297744,0.011672621,0.086208776,-0.03396103,0.016576784,-0.058992453,-0.08544881,-0.021860931,-0.009974569,-0.05718753,-0.0003710777,0.0068693906,0.029852461,-0.0045657405,-0.021219708,0.013536915,-0.01656491,-