	('9ba21988-670e-4974-971f-ef69d317fcfb', '526f774b-07ea-4e7d-abdb-a07a65cec46a', 1, '- G7 statement condemns Iran, supports Israel - Iran-Israel war began on Friday when Israel struck Iran - War has put oil-rich region on edge - US says Trump still aiming for nuclear deal with Iran WASHINGTON, June 16 (Reuters) - The Group of Seven nations expressed support for [Israel](https://www.reuters.com/world/americas/israel-iran-battle-escalates-will-be-high-agenda-world-leaders-meet-2025-06-16/) in a [statement, opens new tab](https://www.pm.gc.ca/en/news/statements/2025/06/16/g7-leaders-statement-recent-developments-between-israel-and-iran) issued late on Monday and labeled its rival [Iran](https://www.reuters.com/business/aerospace-defense/trump-urges-tehran-evacuation-iran-israel-conflict-enters-fifth-day-2025-06-17/) as a source of instability in the Middle East, with the G7 leaders urging broader de-escalation of hostilities in the region. The air war between Iran and Israel - which began on Friday when Israel attacked Iran with air strikes - has raised alarms in a region that had already been on edge since the start of Israel''s military assault on [Gaza](https://www.reuters.com/world/israel-hamas/) in October 2023. The Reuters Daily Briefing newsletter provides all the news you need to start your day. Sign up [here.](https://www.reuters.com/newsletters/daily-briefing/?location=article-paragraph) Advertisement ·', 150, '[-0.07189306,0.024486672,0.028626254,0.0190257,-0.025375396,0.0304037,0.0074956818,0.027293168,0.02836899,-0.0040109497,-0.0074898344,-0.0048265876,-0.026217345,-0.056644432,-0.0067648236,0.060947727,-0.033046484,0.07409148,-0.025656046,0.020943472,-0.0032450103,0.028626254,-0.0077997185,0.018674888,-0.0013345471,0.04635395,-0.050704017,0.025609272,0.034683608,0.019657161,0.071752734,-0.013213916,0.021457996,-0.02893029,-0.030544026,-0.028556092,0.039852235,0.018709969,0.018546257,0.029257715,0.04090467,0.030333538,-0.030239988,0.012407049,-0.04789752