	('9586a7e7-4483-4f88-83ca-f97bcf402301', '526f774b-07ea-4e7d-abdb-a07a65cec46a', 4, 'U.S. was aware of Israel''s strikes in advance and called them "excellent." Washington has warned Tehran not to attack U.S. interests or personnel in the region. "We urge that the resolution of the Iranian crisis leads to a broader de-escalation of hostilities in the Middle East, including a ceasefire in Gaza," the G7 statement said, adding the nations were also ready to coordinate on safeguarding stability in energy markets. An Israeli strike hit Iran''s state broadcaster on Monday while Trump said in a social media post that "everyone should immediately evacuate Tehran." Separately, U.S. Secretary of State Marco Rubio also discussed the Israel-Iran war in phone calls with his British, French and European Union counterparts on Monday. Washington said Trump was [still aiming](https://www.reuters.com/world/middle-east/pentagon-chief-says-trump-still-aiming-deal-with-iran-2025-06-17/) for a nuclear deal with Iran. Reporting by Kanishka Singh in Washington; Editing by Jacqueline Wong and Shri Navaratnam Our Standards: [The Thomson Reuters Trust Principles., opens', 150, '[-0.03756259,0.031029016,0.062363952,0.023031397,-0.027773155,0.015099331,-0.0040752897,0.03465635,0.045013923,-0.0117232865,-0.020791626,-0.025172835,-0.044533193,-0.028122777,-0.013657137,0.047286473,-0.01561284,0.030002,-0.010876544,-0.008232523,-0.017076883,0.020889957,0.0001410953,0.0083253905,0.0010461367,0.031181976,-0.039048485,0.010750898,-0.00665922,0.04706796,0.055895932,-0.024560995,0.02600319,-0.013143629,-0.02508543,-0.026287258,0.022015305,0.0053781806,0.019305728,0.01840982,0.02987089,0.022037156,-0.034678202,0.027576491,-0.022987694,-0.06345652,-0.0331049,-0.0069487514,0.02495432,0.02939016,0.018661112,-0.00023831705,-0.026112447,0.053492274,-0.046762038,-0.042719524,0.028974982,-0.001316548,0.017885387,0.006615517,-0.023184355,-0.039004784,-0.052705623,0.016541524,-0.0023203476,-0.0020622278,0.054541