	('7333e540-9d61-482f-a1b6-88633c961af8', '596d0e4f-227d-4cbd-afab-c44af7b947e7', 1, 'Iran, June 18. Majid Asgaripour/WANA (West Asia News Agency) via REUTERS [Purchase Licensing Rights, opens new tab](https://www.reutersconnect.com/item/smoke-rises-following-an-israeli-attack-in-tehran-iran/dGFnOnJldXRlcnMuY29tLDIwMjU6bmV3c21sX1JDMjQ1RkFVTzk0MA%3D%3D/?utm_medium=rcom-article-media&utm_campaign=rcom-rcp-lead) - Summary - Poll: 83% of Jewish Israelis support attack on Iran - Unity over Iran contrasts with divisions over Gaza - Resilient Netanyahu gets rare support from fierce foes - But support for Iran campaign low among Arab Israelis - [For live coverage of war, please click here](https://www.reuters.com/world/israel-iran-conflict-live-trump-leaves-g7-summit-early-says-should-evacuate-2025-06-17/) JERUSALEM, June 18 (Reuters) - Israel''s [military assault on Iran](https://www.reuters.com/world/iran/) has united much of the nation after a period of bitter divisions over the [war in Gaza](https://www.reuters.com/world/israel-hamas/), transforming the political landscape overnight as even Prime Minister Benjamin Netanyahu''s foes close ranks behind him. Most Israelis support [using force to destroy Iran''s nuclear programme](https://www.reuters.com/world/middle-east/americas/israel-iran-air-war-enters-sixth-day-trump-calls-irans-unconditional-surrender-2025-06-17/), polling shows, despite retaliatory Iranian missile strikes that have killed 24 civilians and put [normal life on hold](https://www.reuters.com/world/middle-east/israeli-resilience-tested-iranian-missile-strikes-hit-home-2025-06-16/). The Reuters Daily Briefing newsletter provides all the news you need to start', 150, '[-0.023003457,0.036169108,0.039399795,0.017950954,-0.00933984,0.010190021,-0.0013982434,0.033011295,-0.0055352827,0.014562378,-0.009637403,0.0051466287,-0.010177876,0.0057812277,0.025942652,0.023355674,-0.011404565,0.03254977,-0.020963022,0.0005101083,-0.011981473,0.0047731563,-0.01546114,-0.