	('6216ab88-dd81-4de4-89db-ae1e8e95db3e', '7e5677e8-dc68-4537-9c8c-418c8fe6198a', 1, 'printed miniature model of U.S. President Donald Trump, Israel and Iran flags are seen in this illustration taken June 18, 2025. REUTERS/Dado Ruvic/Illustration [Purchase Licensing Rights, opens new tab](https://www.reutersconnect.com/item/illustration-shows-3d-printed-miniature-model-of-us-president-donald-trump-israel-and-iran-flags/dGFnOnJldXRlcnMuY29tLDIwMjU6bmV3c21sX1JDMjc1RkFZMFgyOQ%3D%3D/?utm_medium=rcom-article-media&utm_campaign=rcom-rcp-lead) - Summary - US preparations for Iran strikes more extensive than acknowledged - Trump''s decision to back Israel came amid frustration with diplomatic process, pressure from political allies - Israel planned Iran strikes with or without US support, officials say WASHINGTON, June 19 (Reuters) - Roughly one month ago, from the stage at an investment forum in Saudi Arabia, U.S. President Donald Trump [issued a warning](https://www.reuters.com/world/trump-calls-iran-most-destructive-force-vows-it-wont-get-nuclear-weapon-2025-05-13/) to Iran that would prove prophetic. "We''ll never allow America and its allies to be threatened with terrorism or nuclear attack," Trump told the crowd, sending a message to the leadership in Tehran. The Reuters Daily Briefing newsletter provides all the news you need to start your day. Sign up [here.](https://www.reuters.com/newsletters/daily-briefing/?location=article-paragraph) "The time is right', 150, '[-0.036041077,0.033667576,0.0002825787,0.025437726,0.0065432484,0.021400195,0.016911184,0.043780748,-0.015659938,0.022393454,-0.009152163,-0.000582491,-0.032351833,-0.02627619,0.026005302,0.010900039,-0.043832347,0.022406353,-0.013428332,0.003479628,0.01324774,0.03436415,0.03356438,-0.0026717996,0.029875137,0.041536245,-0.036273267,0.012447974,0.039885115,0.019736165,0.07760312,-0.027862823,-0.012976851,-0.062794544,-0.03660865,-0.011080632,0.025644116,-0.020523032,-0.0034957523,0.032919407,0.0148214735,-0