	('9f63881a-8908-4147-8cfd-96a8ad4a3376', '7e5677e8-dc68-4537-9c8c-418c8fe6198a', 12, 'understood that Washington would stand by it, said a separate official. By the time Trump talked to Netanyahu on Monday, June 9 - one of many phone calls in recent days - his stance was one of tacit, if not explicit approval, according to one U.S. and one Israeli official. The Wall Street Journal reported that Trump had said he would like more time to see diplomacy play out. But the U.S. official said that he did not explicitly veto Israel''s plans. By Wednesday, June 11, it was clear to Washington that Israel''s plans were a go. That day, Reuters reported that the U.S. was [preparing a partial evacuation](https://www.reuters.com/world/middle-east/us-embassy-iraq-preparing-ordered-evacuation-due-heightened-security-risks-2025-06-11/) of its Iraqi embassy amid fears of reprisals from Iran following an imminent attack. The next day, June 12, Washington [sent](https://www.reuters.com/world/middle-east/us-gave-regional-allies-heads-up-israels-planned-attack-iran-2025-06-13/) a formal diplomatic note to several regional allies, warning them that an attack was imminent.', 146, '[-0.014638518,0.016452244,0.032974698,0.03412144,-0.038895633,0.031196075,0.04072106,0.015902275,0.022115747,-0.0014473235,0.0035075108,0.008255376,-0.041797593,-0.026024032,-0.019014861,0.030166347,-0.016066095,0.035759643,-0.020594558,-0.010069101,-0.002701573,0.063889936,-0.015317203,0.022771029,-0.0022203508,-0.012625868,-0.034636304,0.0069916183,0.019681845,-0.022583805,0.04556546,-0.015235293,0.015562933,-0.020828588,-0.059396576,-0.008606419,0.039644524,-0.0265623,0.032787472,0.035923462,0.0006973335,0.029838707,-0.026187852,0.06772801,-0.0030394525,-0.027357997,-0.010045698,0.004051628,0.009922832,0.017575582,0.024502844,0.04437191,-0.030330168,0.06253257,-0.048771657,-0.032272607,0.005119386,0.0033612426,-0.002375395,0.0040253,-0.008109108,-0.052703347,-0.022677416,0.02906641,0.0021106496,0.0062427255,0.