	('1ae7d36d-e0b8-4333-8766-d0603b5b3694', '7e5677e8-dc68-4537-9c8c-418c8fe6198a', 14, 'by Trump, according to two U.S. officials. Almost immediately, a political civil war erupted in Trump''s Republican Party, with several high-profile conservatives, including members of Congress, accusing his administration of fanning the flames of war. Seven days on, the U.S. intelligence community believes the strikes have set Iran''s nuclear ambitions back by only months, according to a source familiar with U.S. intelligence reports, confirming a CNN report. A significant blow to Iran''s nuclear ambitions, [most analysts say](https://www.reuters.com/world/china/how-much-damage-have-israeli-strikes-caused-irans-nuclear-programme-2025-06-16/), will require dropping bunker-busting bombs on the Fordow Fuel Enrichment Plant, the crown jewel of Iran''s nuclear program. Only the U.S. has that capability. Trump has said he is considering such a strike, which would represent a major escalation for the United States. As of Thursday, his intentions were [still unclear](https://www.reuters.com/world/middle-east/americas/israel-iran-air-war-enters-sixth-day-trump-calls-irans-unconditional-surrender-2025-06-17/). Reporting by Gram Slattery, Phil Stewart, Steve Holland and Jonathan Landay in Washington; Additional reporting by Idrees Ali and Trevor Hunnicutt in', 150, '[-0.028302738,0.04626925,0.03910215,0.015065541,0.00035424132,0.013517544,0.010001033,0.014151369,0.01574812,-0.0007694274,-0.0031173236,0.015199618,-0.059530824,-0.038224544,-0.009367207,0.026620664,-0.02654753,0.01947794,-0.02805896,-0.0074840146,-0.00058621226,0.032276336,0.00024739758,-0.027156977,0.029814169,0.010494685,-0.047341876,-0.0046439893,-0.0025154944,-0.009172183,0.0719148,-0.014163558,0.020136142,-0.049438376,-0.021074692,-0.025523659,0.050120957,-0.008093461,0.043807082,0.03742007,0.002699852,-0.013992913,-0.048609525,0.005357043,-0.010177772,-0.068891935,-0.022549555,-0.0021391604,0.026620664,0.034836017,-0.025