	('19b4d6a5-a6c9-4a41-851c-1ef30cc21827', 'e517c3f6-0ec2-4691-bd8c-9c7684f94c2f', 3, 'across Iran, truck drivers are defying arrests and mounting pressure from authorities, as support for their protest spreads across key sectors. ![Policing without batons: Iran expands use of tech to preempt dissent](https://i.iranintl.com/images/rdk9umy0/production/110a44894ece264f80bf03963cd4e82b392b7cbc-1368x825.jpg?rect=65,0,1238,825&w=600&h=400&q=80&fit=crop&auto=format) The Islamic Republic has entered a new phase of security governance—one where control is no longer maintained solely through arrests and bullets, but through data analysis, surveillance, and information engineering. ![Truckers'' strike persists as Tehran''s steps up arrests](https://i.iranintl.com/images/rdk9umy0/production/67a401cc7e828a0c7fdc8c33852813e4dd709f0a-620x620.png?rect=0,104,620,413&w=600&h=400&q=80&fit=crop&auto=format) A week into a sweeping truckers’ strike in Iran, the protest appeared to be continuing unabated despite increased arrests by authorities according to sources close to the movement. ![Iran truckers face arrests and pressure as nationwide strike enters sixth day](https://i.iranintl.com/images/rdk9umy0/production/3f9ea6f70f1b4895f501fb8a76d84359ec9391a0-604x453.png?rect=0,26,604,403&w=600&h=400&q=80&fit=crop&auto=format) Iran''s security forces have escalated efforts to suppress the nationwide truck drivers'' strike through arrests, summonses, and intimidation, particularly in the southern city of Sirjan, as the strike stretches into its sixth day. ![Iran arrests some striking truckers as protest', 150, '[-0.021481115,0.009816165,0.021179272,0.007181333,0.019292757,-0.0263609,-0.009105578,0.034812484,0.0029366745,0.016676791,-0.00016339969,0.005511767,-0.024398925,0.015620342,0.0342088,0.03697569,-0.020349206,0.019582024,-0.058104653,0.0033391311,0.030335156,0.04432052,0.04701195,-0.015771262,0.0032416612,-0.017179862,-0.028524103,-0.008533335,-0.022952596,-0.052118115,0.04711256,-0.04