	('411c9068-2050-443f-a6d3-789e5b099472', 'e517c3f6-0ec2-4691-bd8c-9c7684f94c2f', 4, 'truck drivers'' strike through arrests, summonses, and intimidation, particularly in the southern city of Sirjan, as the strike stretches into its sixth day. ![Iran arrests some striking truckers as protest reaches fifth day](https://i.iranintl.com/images/rdk9umy0/production/b993917436a6166b1959f24b6fb080f6f1825b2a-1200x675.jpg?rect=94,0,1013,675&w=600&h=400&q=80&fit=crop&auto=format) Authorities have arrested several striking truck drivers in the southern city of Shiraz, according to the provincial prosecutor, as a nationwide truckers’ strike entered its fifth day on Monday. ![Hardline daily says chaos in Iran is what US wants from talks](https://i.iranintl.com/images/rdk9umy0/production/e8f527ff1864168e5fe1baccc8a6115164e5f8f7-1200x900.jpg?rect=0,17,1017,678&w=600&h=400&q=80&fit=crop&auto=format) Warnings of unrest are growing louder in Iran, with the hardline daily Kayhan the latest to raise the alarm—pointedly avoiding Tehran’s governance failures and instead pinning potential protests on Washington and its alleged scheming. ![Iran truckers strike enters fourth day as protests spread to more cities](https://i.iranintl.com/images/rdk9umy0/production/c211b4fe18d4ad1b7852d06767d0009aad72e566-600x400.webp?w=600&h=400&q=80&fit=crop&auto=format) A nationwide truck drivers’ strike in Iran entered its fourth day on Sunday, with protests spreading to dozens of cities and major highways despite a police crackdown and arrests.', 150, '[-0.0545597,0.023449626,0.012895493,-0.000624738,-0.0036110983,-0.03347545,-0.003485025,0.002299336,-0.005211028,0.028240409,-0.015308895,0.009485511,-0.03542058,0.008440904,0.005208026,0.037461765,-0.030521734,0.024242086,-0.06685484,0.025238665,0.029633218,0.029897371,0.0420004,-0.005337101,0.037221625,-0.00316684,-0.023809833,-0.031866517,-0.0196194,-0.04224054,0.02800027,-0.034243897,0.027087739,-0.074155085,-0.03534854,-0.025358735,0.02691964,-0.0221288