	('26c0da57-9721-4876-9d77-d6ff0bee0cd0', 'e517c3f6-0ec2-4691-bd8c-9c7684f94c2f', 7, 'to engage with senior Trump administration officials to oppose Tehran. ![Slain Israeli embassy staffer had expressed solidarity with Iranian people](https://i.iranintl.com/images/rdk9umy0/production/8cddecf9220a81f33448958a060ad7853bb7416c-1940x1294.jpg?rect=0,1,1940,1293&w=600&h=400&q=80&fit=crop&auto=format) Yaron Lischinsky, one of two Israeli embassy employees killed in a shooting outside the Capital Jewish Museum in Washington, had publicly expressed solidarity with the Iranian people and participated in events supporting democracy in Iran. ![Iran issued secret death penalty for ''spreading corruption''](https://i.iranintl.com/images/rdk9umy0/production/0bc333b46b3d5ebf80e679ac568975da6b8d33cc-896x504.jpg?rect=175,12,721,481&w=600&h=400&q=80&fit=crop&auto=format) Iranian political prisoner Ehsan Faridi has been sentenced to death on charges of “spreading corruption on earth,” a ruling quietly issued months ago but only recently made public, according to information obtained by Iran International. ![Iran’s police-school pact sparks fear of hijab policing in classrooms](https://i.iranintl.com/images/rdk9umy0/production/0c4257e88eebcc716fbe6ca6a0e18356be4f90a9-600x316.webp?rect=63,0,474,316&w=600&h=400&q=80&fit=crop&auto=format) A cooperation agreement between Iran’s police and the education ministry has sparked backlash from the teachers'' union, which fears the deal aims to reassert control over increasingly relaxed hijab compliance in schools. Load More', 142, '[-0.016242892,0.009553519,0.0016421106,0.03958887,-0.0045126216,0.031594716,0.014448027,0.034497052,-0.0027368509,-0.0026397882,-0.00870064,-0.010374575,-0.023638755,-0.0069121397,0.019310711,0.010686449,-0.0030741838,0.045062568,-0.02045637,0.039079685,0.0010398442,0.024491634,0.021423815,0.021602029,0.037450306,-0.03319864,0.029608909,-0.031594716,0.00076337456,-0.019972647,0.07378041,-0.03780673,0.014053412,-0.049797