	('c89f7116-843f-4df2-9171-f5ea495d75d8', '66849481-f328-4ea3-9ae1-806eb91c546b', 3, 'residents of Tehran, a city of 10 million people, on Wednesday jammed highways out of the city as they sought sanctuary from [intensified Israeli airstrikes](https://www.reuters.com/world/israel-iran-conflict-live-trump-leaves-g7-summit-early-says-should-evacuate-2025-06-17/). Advertisement · Scroll to continue The Wall Street Journal said Trump had told senior aides he approved attack plans on Iran but was holding off on giving the final order to see if Tehran would abandon its nuclear program. Asked if he thought the Iranian government could fall as a result of the Israeli campaign, Trump said: "Sure, anything could happen." Referring to the destruction or dismantling of Iran''s Fordow nuclear enrichment center, Trump said: "We''re the only ones that have the capability to do it. But that doesn''t mean I''m going to do it - at all." Military analysts believe that Israel might need U.S. military help to destroy Fordow, dug beneath a mountain near the city of Qom.', 146, '[-0.033844527,0.02147589,0.051000625,0.03251536,-0.010787174,-0.012959377,0.008436518,0.04984376,-0.0030321619,0.002730638,-0.035050623,0.015482333,-0.015728474,-0.00022998895,-0.021205135,0.01875602,0.011931734,-0.0051935962,-0.004624393,0.006332003,-0.010885631,0.051985193,-0.011550214,-0.03251536,0.036182877,0.02029441,-0.032539975,0.01246094,0.00049074565,0.005092063,0.08053767,-0.025204942,0.00015826162,-0.07044584,-0.04393635,-0.056908034,0.052871305,-0.003972117,0.020442095,0.02466343,0.0050428347,0.010319504,-0.02164819,0.05400356,-0.0066581415,-0.037684344,-0.00012845536,-0.029709341,0.0061227824,0.034139898,-0.01591308,-0.020023653,-0.036109034,0.030423153,-0.028380174,-0.04135186,-0.02109437,0.0055258884,-0.0123501755,-0.011199461,-0.014042402,-0.041105717,0.013008606,0.027641747,0.04322254,0.026731022,0.09210634,0.015654633,0.012165569,0.05139445,-0.019457527,0.022251237,0.0031413874,0.0057289554,0.050