	('c07a7142-684e-4a5d-bf05-63df601b0349', '66849481-f328-4ea3-9ae1-806eb91c546b', 12, 'all of them civilians, according to Israeli authorities. ## LEVERAGE Iran has been exploring options for leverage, including veiled threats to hit the global oil market by restricting access to the Gulf through the Strait of Hormuz, the world''s most important shipping artery for oil. Inside Iran, authorities are intent on preventing panic and shortages. Fewer images of destruction have been allowed to circulate than in the early days of the bombing, when state media showed pictures of explosions, fires and flattened apartments. A ban on filming by the public has been imposed. The communications ministry said on Wednesday that temporary restrictions on internet access would be imposed to help prevent "the enemy from threatening citizens'' lives and property". Iran''s ability to hit back hard at Israel through strikes by proxy militia close to Israeli borders has been limited by the devastating blows Israel has dealt to Tehran''s regional allies', 150, '[-0.008493543,0.025192497,0.05221399,0.033397913,-0.01606006,-0.0038897416,-0.0009309386,0.044146378,-0.008061348,0.012539876,0.024603713,-0.026282378,-0.035126686,-0.008925736,-0.013203826,0.019442445,0.00813025,0.017563343,-0.013993048,-0.00023508353,0.04229233,0.024779096,-0.03685546,-0.009821441,0.03382384,0.0058126897,-0.007854648,-0.008048821,0.03665502,-0.0077982745,0.07847131,-0.0362792,0.0006803916,-0.050435103,-0.052865412,-0.021947915,0.04016268,-0.018252347,0.04364528,0.027209401,-0.0044691316,-0.013855248,-0.060081165,0.01752576,-0.021810114,-0.06273696,0.029414214,-0.0362792,0.018791024,0.028737737,0.0057187346,-0.0064202663,0.0034857348,0.010554291,-0.023138013,-0.030316183,-0.033573292,0.033899006,-0.023313396,-0.011594061,-0.032170232,-0.048606113,-0.028286753,0.042818476,-0.0075477273,0.0051675313,0.052564755,0.03632931,-0.0008471619,0.049483027,0.0041622114,0.014055685,0.027234456,0.019104207,0.033673514,-0.001434